import React, { useState, useEffect } from 'react';
import axios from 'axios';

function Request15() {
  const [posts, setPosts] = useState([]);

  useEffect(() => {
    axios.get('http://localhost:8000/albums?limit=15')
      .then(response => {
        setPosts(response.data);
      })
      .catch(error => {
        console.error(error);
      });
  }, []);

  return (
    <ul>
      {posts.map(post => (
        <li>{post.name}</li>
      ))}
    </ul>
  );
}

export default Request15;
